  input: 'TEXT,F3XA,,"Attached is the amended report in response to the FEC inquiry
    dated April 14, 2006. As stated on the phone, the amended report addresses 3 items:
    a) the disbursement to TVB USA, Inc. has been clarified as a refund; b) the contributions
    from ''Acteva'' were the bulked receipts of contributors to the PAC who used an
    online credit card service.  As clarified through phone conversation with Mr.
    Hartsock, the report has been amended, substituting the actual contributors and
    their contributions for the former ''Acteva'' bulked contribution entries;  c)
    the increase in contributions amount between the original filing and the first
    amended filing was because of a software error, which was addressed in an electronic
    letter dated March 6, 2006, to the FEC. "'
